moment.locale("ru");
var myMap;
var ROUTE = {
  2: {
    color: "#ff0000",
    hint: "Дороги нет"
  },
  3: {
    color: "#ffa500",
    hint: "Плохое качество"
  },
  4: {
    color: "#008000",
    hint: "Хорошее качество"
  }
}


function init() {
  $.getJSON('map.json')
  .done(function(data) {
    myMap = new ymaps.Map("map", {
      center: [60.575672,45.416392],
      zoom: 7
    });
    ymaps.route([
      [59.659689,40.576365],
      {
        type: "viaPoint",
        point: [61.212096, 47.765519]
      },
      [60.896978, 49.774300]
    ], {mapStateAutoApply: true}).then(
      function(route) {
        // ============================================
        var path = route.getPaths().get(0);
        var segments = path.getSegments();
        var polyline = [];
        // информация о маршруте
        // myMap.geoObjects.add(route);

        _.each(segments, function(i) {
          // console.log(i.getCoordinates());
          polyline =_.concat(polyline, i.getCoordinates());
        });

        var quality = drawRoute(data, polyline, myMap);

        $("#info").loadTemplate($("#template-info"), {
          length: path.getHumanLength(),
          duration: path.getHumanTime(),
          good: Math.ceil(quality[4] / 1000) + " км",
          poor: Math.ceil(quality[3] / 1000) + " км",
          abcent: Math.ceil(quality[2] / 1000) + " км"
        });

        // ===========================================
      },
      function(error) {
        $("#info").loadTemplate($("#template-error"), {
          msg: error.message
        });
        console.error('Возникла ошибка: ' + error.message);
      }
    );
  })
  .fail(function(err) {
    $("#info").loadTemplate($("#template-error"), {
      msg: err.responseText
    });
    console.error(err.responseText);
  });
}

ymaps.ready(init);
function prepareData(data) {
  // преобразуем массив
  var route = _.map(data, function(i) {
    var dist = _.first(_.keys(i));
    var eval = i[dist];
    return {
      dist: parseInt(dist),
      eval: eval
    };
  });

  // ставим дистанцию в начало...
  var beginDist = _.first(route).dist;
  route = _.map(route, function(i) {
    return {
      dist: i.dist - beginDist,
      eval: i.eval
    };
  });

  // преобразуем в пары

  var pairs = [];

  _.each(route, function(i, k) {
    if (k < route.length - 1) {
      var result = {
        bgn: i.dist,
        end: route[k + 1].dist,
        eval: i.eval
      }
      pairs.push(result);
    }
  });
  return pairs;
}

function findCoordsByDistance(polyline, distance) {
  // поиск индекса координаты на ломаной по расстоянию
  var summ = 0;
  for (var i = 0; i < polyline.length; i++) {
    var k = i == 0 ? 1 : i - 1;
    summ += ymaps.coordSystem.geo.getDistance(polyline[k], polyline[i]);
    if (summ > distance) {
      break;
    }
  }
  return i;
}

function countDistanceByPolyline(polyline) {
  var result = _.reduce(polyline, function(s, p) {
    s.distance += ymaps.coordSystem.geo.getDistance(s.coord, p);
    s.coord = p;
    return s;
  }, {
    coord: polyline[0],
    distance: 0
  });
  return result.distance;
}

function drawRoute(data, polyline, map) {
  data = prepareData(data.track);
  var quality = {
    2: 0,
    3: 0,
    4: 0
  };
  _.each(data, function(i) {
    var bgn = findCoordsByDistance(polyline, i.bgn * 1000);
    var end = findCoordsByDistance(polyline, i.end * 1000);
    var rr = countDistanceByPolyline(polyline.slice(bgn, end + 1));
    // console.log(rr);
    quality[i.eval] += rr;
    var line = new ymaps.Polyline(polyline.slice(bgn, end + 1), { 
            // Описываем свойства геообъекта.
            // Содержимое балуна.
            balloonContent: "<b>" + ROUTE[i.eval].hint + "</b>" + "<br/>От Чекшино: " + i.bgn + " км" + "<br/>Протяжённость: " + Math.ceil(rr / 1000) + " км",
            // hintContent: ROUTE[i.eval].hint
            // balloonContent: `${ROUTE[i.eval].hint} <br>Протяжённость: ${Math.ceil(rr / 1000)} км`,
        }, {
            // Задаем опции геообъекта.
            // Цвет линии.
            strokeColor: ROUTE[i.eval].color,
            // Ширина линии.
            strokeWidth: 4,
            // Коэффициент прозрачности.
            strokeOpacity: 0.75
        });
        map.geoObjects.add(line);
  });
  return quality;
}